  const [count, setCount] = useState(0);


  const handleClick = useCallback(() => {
    console.log("hello world!!");
  },[]);

  return (
    <div>
      <h2>Count: {count}</h2>
      <UseCallbackB  Learning={handleClick}/>
      <button onClick={() => setCount(count + 1)}>Increment</button>
    </div>
  );
}


export default UseCallbackA;
